#include <string.h>
#include <stdlib.h>
#include <stdio.h>
#include <ctype.h>

const char * constinp = "";
//const char * constinp = "vVuyYJjUzzZPxX";

//const char * constinp = "dabAcCaCBAcCcaDA";

int main()
{
	char * inp = malloc(strlen(constinp));
	strcpy(inp, constinp);
	printf("STR: %s\n", inp);
	int has_changed = 1;
	while (has_changed) {
		has_changed = 0;
		size_t len = strlen(inp);
//		printf("Len: %lu %s\n", len, inp);
		printf("Len: %lu \n", len);
		for (int i = 1; i < len; i++) {
			if (inp[i] != inp[i - 1] &&
			    (inp[i] == tolower(inp[i - 1]) ||
			    tolower(inp[i]) == inp[i -1])) {
				for (int j = (i - 1); j < len - 2; j++) {
					inp[j] = inp[j+2];
				}
				inp[len - 2] = '\0';
				has_changed = 1;
			}

		}
	}
	printf("%lu\n", strlen(inp));
	return 0;
}
